    if (isFinal && /[^aeiou]le$/.test(text)) return "le";
    if (syllableHasRControlled(text)) return "r";
    if (syllableHasVowelTeam(text)) return "vt";
    if (isVceSyllable(text)) return "vce";
    if (/[aeiouy]$/.test(text)) return "open";
    return "closed";
